//Установка модулей
function InstallModule(id)
{
    var moduleID = id;
    var siteURL = $('#siteURL').val();
    var error = false;

    if(!moduleID.length)
    {
        error = true;
        alert('Не указан ID модуля.');
    }
    else if(!siteURL.length)
    {
        error = true;
        alert('Введите полный адрес Вашего сайта, включая http://');
    }
    else if(siteURL =='http://www.')
    {
        error = true;
        alert('Введите адрес вашего cайта, например http://tuning-soft.ru');
    }

    if(error == true)
        return false;
    else
    {
        if(siteURL && moduleID)
        {
            var siteTMPURL = siteURL + "/bitrix/admin/update_system_partner.php?addmodule="+moduleID;
            //siteTMPURL = siteTMPURL.replace("#MODULE#", module);
            window.open(siteTMPURL);
        }
    }
}
